import "./App.css";
import React from 'react'
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import Search from "./Components/Search";
import Home from "./Components/Home";


function App() {


  return (
    <BrowserRouter>
    <div className="app">
        <Routes>
            <Route path="/" element={<Home/>} />
        </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
